About the author:
William Schnoebelen has been a serious student of the UFO phenomenon for thirty years. For half that time, he was involved in high level occult and satanic groups. Now, he is a Born Agian servant of Jesus Christ. From his unique background and perspective, he is able speak to the UFO mystery both from the standpoint of the Bible, and from the inner councils of the Satanic brotherhood. Is Satan behind UFOs and what is he trying to do? This book offers an explanation for the sudden rise of interest and media ttention in UFOs, the mysterious terror of alien abductions, and what this all should mean to us as followers of the Lord Jesus Crhis and students of End-times Prophecy. A compelling and informative book!&quot;
